			"banned": 0,
			"closed": 0,
			"comment": "Двач, я кажется поехал.<br>Начну по порядку.<br>Недели две назад вечером почувствовал, что какая-то хуйня кусает за ногу, ну почесался и забыл. Следующие пару дней мне все казалось, что какие-то ощущения неочень, как будто чесотка начинается.<br>Сходил в квд на всякий, там врач после осмотра сказала, что все норм, на чесотку нихуя не похоже, пей витамины и нервничай поменьше.<br>Я вроде поуспокоился, но я решил ещё дважды в день мыться с дегтярными шампунем и мылом, и каждый день менять белье, одежду и постель. Собсно неделю я так и делал, почувствовал, что зуд вроде не появляется почти, укусы тоже, но заметил у себя на руке ходы под кожей, как от чес.клещей. тогда списал все на плохое освещение и забыл.<br>Самочувствие было вполне себе норм, вчера вечером сел доделывать учебу, в итоге досидел до утра, съездил по делам, потом в универ. Вернулся домой и решил досидеть до вечера и спать, чтобы не сбивать режим окончательно.<br>И вот решил я, что пора передернуть и на боковую.<br>Включил прон, достал хуей, оттянул крайнюю плоть, увидел какую-то хуйню, как будто с трусов нитка какая, убрал с хуя на бумажку, чтоб потом выкинуть, и тут вдруг замечаю, что нитка очень тонкая, и больше паутинку напоминает, а на ней две белые точки, которые шевелятся. Сразу подумал, что сквозняком или еще чем её пошевелило. Лупа была рядом, глянул через нее на эту хуйню и ОХУЕЛ, ДВЕ ЕБУЧИХ ТОЧКИ ПРАВДА ШЕВЕЛИЛИСЬ И АКТИВНО ХУЯРИЛИ ВОКРУГ СЕБЕ ПО КОКОНУ ИЗ ЭТОЙ ПАУТИНКИ. <br>Блять, двач, у меня до сих пор в себя придти не могу.<br>Занять пытался, но из-за размера их даже через лупу не получилось.<br>Блять, анон, скажи хоть что-нибудь.<br>Я сейчас обосрусь. ",
