			"comment": "<strong>ПРИЗЫВА В АРМИЮ ТРЕД</strong><br><br>Сап б. Заканчиваю в этом году шарагу. В армию идти не хочу. Не то чтобы я боюсь дедовщины и унижений (сам я вполне крепкий, частенько пиздил других в школе), просто не хочу целый год заниматься бесполезной хуйней. Больших проблем со здоровьем нет и прочих уважительных причин тоже нет, есть только категория Б (всякая хрень в купе: скалиоз, гастрит и что-то с давлением) в приписном свидетельстве, но это как вы понимаете хуйня. Особых отношений с военкоматом тоже нет - последний раз в военкомате был еще в школе. Собственно интересуют ваши истории откоса от армии. В первую очередь хотелось бы почитать истории тех анонов кто откосил по болезни, т.е. не действительно больных у кого Г или Д без вариантов, а тех кто смог поправить свою категорию с Б например на В и тех кто сумел доказать свою правоту военкому. А также тех кто знаком с этой системой и знает как она работает и какие есть варианты или подводные камни.<br><br>ЗЫ Не хотелось бы видеть в этом треде очередной срач на тему дедовщины, &quot;служил - не мужик&quot; и прочего. Просто тред о том как вы не пошли на срочную службу в армию по болезни (или по другим причинам) и все. Ваши переживания и ваши мысли по вопросу срочной службы в армии не интересны, они известны и их я уже много раз слышал.",
